import Link from 'next/link';
import { css, jsx } from "@emotion/core";
import styled from "@emotion/styled"

const Container = styled.div`
  display: block;
  position: fixed;
  padding: 20px 200px;
  margin: 0px;
  top: 0px;
  left: 0px;
  right: 0px;

  background-color: #BBBBBB;
  a{
    margin-left: 10px;
    margin-right: 10px;
    text-decoration: none;
  }
`;

const MemberWrapper = styled.div`
  display: flex;
  justify-content: flex-end;
  
  margin: 20px 30px 0px 30px;
  font-size: 13px;
  a{
    font: normal normal 16px Noto Sans CJK KR;
    color: #9A9A9A;
  }
  #bar{
    margin:0px;
  }
`;


const Menu = styled.span`
  display: inline;
  float: left;
  
  margin: 10px 30px;
  font-size: 15px;
  a{
    font: normal 500 16px Noto Sans CJK KR;
    color: #707070;
  }
  .menu{
    margin-right: 40px;
  }
  #logo{
    font: normal bolder 26px Noto Sans CJK KR;
    color: #767676;
    margin-right: 80px;
  }
`;

const Rank = styled.span`
  display: inline-block;
  float: right;
  right: 0px;
  width: 300px;
  background-color: linen;

  margin: 10px 30px;
  a{
    font: normal 500 16px Noto Sans CJK KR;
    color: #707070;
  }
`;

const ShowRank = styled.span`
  width: 600%;
`;//?????????


const Header = () => (
  <Container>
    <MemberWrapper>
      <Link href="/">
      <a className='membership'>로그인</a>
      </Link>
      <a id='bar'>｜</a>
      <Link href="/">
        <a className='membership'>회원가입</a>
      </Link>
    </MemberWrapper>



    <Menu>
      <Link href="/">
        <a id='logo'>로고 OR 웹사이트명</a>
      </Link>
  
      <Link href="/">
        <a className='menu'>사이트 소개</a>
      </Link>
      <Link href="/">
        <a className='menu'>나의 사이트</a>
      </Link>
    </Menu>


    <Rank>
    <ShowRank>
      <a>1</a><a>더블슬래시</a>
    </ShowRank>
      <a id='listdown'>ㅁ</a>
    </Rank>
  </Container>
);

export default Header;
